// import './img'

import './Nav.css';
import {
    Link
} from "react-router-dom";
import search from './img/search.svg'
import person from './img/person.svg'
import bag from './img/bag.svg'


function Nav() {
    return (
        <div className="nav">
            <div className='nav_left'>
                {/* ESSENTIALS HOLIDAY 2020
SHOP
OVERVIEW
LOOKS
 */}
                <ul style={{ padding: 0 }}>
                    {/* <li></li> */}
                    <li>SHOP</li>
                    <li>ESSENTIALS HOLIDAY 2020</li>
                    {/* <li>MEN</li>
                    <li>ART OF LIVING</li>
                    <li>MAGAZINE</li> */}
                </ul>
            </div>
            {/* <div> */}
            <div className='logo'><Link to='/'>ESSENTIALS</Link></div>
            {/* </div> */}
            <div className='nav_right'>
                <div className='search'>
                    {/* <img width='20px' src={search} alt='' /> */}
                    <input placeholder='Search' />
                    <p> &nbsp;&nbsp;</p>
                </div>
                <div className='login'>
                    <Link to='/login'><img width="24" src={person} alt="" /></Link>
                    {/* <li></li> */}
                </div>
                <div className='cart'>
                    <Link to='/cart'> <img width="24" src={bag} alt="" /></Link>
                </div>

            </div>
        </div>
    );
}

export default Nav;
